import SixthSection from "./SixthSection";
import useQuickBlox from "../../../hooks/useQuickBlox";

function Home() {
    return(
        <>
            <FirstSection />
            <ThirdSection />
            <FourthSection />
            <FifthSection />
            <SixthSection />
        </>
    )
}

export default Home;
